import React from "react";
import { Footer } from "../home/footer";
import { Navigation } from "../home/navigation";
import "./styles.css";

const SoftwareQualityAssurance = () => {
  return (
    <React.Fragment>
      <Navigation />
      <div className="section_container_assurance">
        <div className="section_container_assurance_wrapper">
          <div className="section__container_assurance">
            <div className="section_banner_assurance">
              <h1>PROFESSIONAL SOFTWARE QUALITY ASSURANCE AND ANALYSIS</h1>
            </div>
            <div className="section_item_assurance">
              <p>
                {" "}
                Starting and running a successful business is no joke. There are
                a plethora of aspects, daily operations, and financial
                activities you need to keep track of, ensuring your company runs
                smoothly and with minimal hiccups.{" "}
              </p>
              <p>
                {" "}
                However, this is often easier said than done. You need to work
                long hours, wear a variety of hats and handle many tasks
                yourself before you can taste the fruits of your labour. During
                the initial growing years of your small and medium business,
                it’s crucial for you to take advantage of all the help you can
                get.{" "}
              </p>
              <p>
                {" "}
                This is why we at Test Harness offer our services to startup or
                SME owners, looking to find their feet in a grueling and
                competitive market or industry. We are a UK-based software QA
                platform hoping to help you and other entrepreneurs like
                yourself overcome software, website, and browser bugs and
                glitches.{" "}
              </p>
              <p>
                {" "}
                Our team of highly skilled and experienced IT specialists caters
                to SMEs around the world and can ease your burden too. With our
                professional software quality analysis, we’re able to uncover
                any hidden bugs, glitches, and issues in your software and
                websites.{" "}
              </p>
              <p>
                {" "}
                You can trust our Software Quality Assurance services and
                reliable technicians and specialists to run a complete
                diagnosis, analyse and test all the features of your software,
                provide detailedreports and Software Quality Assurance solutions
                to ensure smooth sailing and minimize any bumps and hiccups on
                your road to corporate success.{" "}
              </p>
              <p>
                {" "}
                We understand the importance of running a successful business
                and staying afloat without burning a giant hole in your pockets,
                which is why we strive to make our software QA services as
                affordable and cost-effective as possible.{" "}
              </p>
              <p>
                {" "}
                With our affordably priced packages, all small and medium-sized
                businesses can provide effective services to their clients.
                We’ve designed our pricing packages to help you find the right
                one, based on your budget and needs.{" "}
              </p>
              <p>
                {" "}
                You can either subscribe to our most affordable and
                cost-effective package─ Lite and get detailed bug reports,
                re-testing and testing one new feature a month. If you want to
                go all out, we do have our Premium package that offers a lot
                more for a very reasonable price.{" "}
              </p>
              <p>
                {" "}
                At the end of the day, it doesn’t matter what package you sign
                up for or what bugs and glitches you need help with our software
                QA services and solutions will not disappoint. If you’re not
                sure what package fits your needs, don’t worry, get in touch
                with us and we’ll help you in any way we can!{" "}
              </p>
              <p>
                {" "}
                When it comes to providing professional software Quality
                Analysis and assurance services and solutions, Test Harness,
                remains unparalleled.{" "}
              </p>
            </div>
          </div>
        </div>
      </div>
      <Footer />
    </React.Fragment>
  );
};

export { SoftwareQualityAssurance };
